import { useState } from "react";
import store from "../redux/Store";
import { CredentialsModel } from "../models/CredentialsModel";





function SetCredentials(): JSX.Element {


    const [token, setToken] = useState<string>("");
    const [identifier, setIdentifier] = useState<string>();

    const handleSubmit = () => {
      // Create a new CredentialsModel instance with the provided token and name
      const newCredentials = new CredentialsModel(token, name);

      // Dispatch the action to save the newCredentials to the Redux store
      dispatch(setCredentials(newCredentials));

      // Clear the input fields
      setToken('');
      setName('');
    };

    return (


<Card className="main-card">
              <Typography align='center' fontWeight="bold" mt={5}>
                כדי להתחיל, יש להקיש את פרטי ההזדהות מפורטל העוסקים של ״מאגר אל תתקשר אליי״
              </Typography>
              <Container style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
              <Button>
    <HelpOutline />
איך מפיקים פרטי זיהוי?
  </Button>

                </Container>
              <CardContent>

                <TextField
                  fullWidth
